"original": |2-
     The currently-defined "warn-code"s are listed below, with a
     recommended warn-text in English and a description of their meaning.
     These warnings describe failures induced by the session description.
     The first digit of warning codes beginning with "3" indicates
     warnings specific to SIP.  Warnings 300 through 329 are reserved for
     indicating problems with keywords in the session description, 330
     through 339 are warnings related to basic network services requested
     in the session description, 370 through 379 are warnings related to
     quantitative QoS parameters requested in the session description, and
     390 through 399 are miscellaneous warnings that do not fall into one
     of the above categories.
"fixed": |-
  The currently-defined "warn-code"s are listed below, with a recommended warn-text in English and a description of their meaning. These warnings describe failures induced by the session description. The first digit of warning codes beginning with "3" indicates warnings specific to SIP.  Warnings 300 through 329 are reserved for indicating problems with keywords in the session description, 330 through 339 are warnings related to basic network services requested in the session description, 370 through 379 are warnings related to quantitative QoS parameters requested in the session description, and 390 through 399 are miscellaneous warnings that do not fall into one of the above categories.
"ko": |-
  현재 정의된 "경고 코드"는 영어로 된 권장 경고 텍스트 및 해당 의미에 대한 설명과 함께 아래에 나열되어 있습니다. 이러한 경고는 세션 설명으로 인해 발생한 오류를 설명합니다. "3"으로 시작하는 경고 코드의 첫 번째 숫자는 SIP 관련 경고를 나타냅니다. 경고 300부터 329까지는 세션 설명에서 키워드에 문제가 있음을 나타내기 위해 예약되어 있고, 330부터 339까지는 세션 설명에서 요청한 기본 네트워크 서비스와 관련된 경고, 370부터 379까지는 세션 설명에서 요청한 정량적 QoS 매개변수와 관련된 경고, 390은 399부터 399까지는 위 범주 중 하나에 속하지 않는 기타 경고입니다.
